insert into Producteur (id_producteur, id_utilisateur, description, country, city, street_address, longitude, latitude, phone_number, image) values (190, 24, 'Nous sommes une petite entreprise familiale, qui produit des aliments bio et locaux de qualité supérieure. Nous sommes convaincus que la nourriture doit être saine, savoureuse et respectueuse de l''environnement. C''est pourquoi nous cultivons nos produits en harmonie avec la nature, en utilisant des méthodes biologiques et des semences naturelles. Nous sommes fiers de vous proposer une variété de produits frais et de saison, cueillis à la main et livrés chez vous en toute sécurité. Nous sommes impatients de vous faire découvrir nos produits de qualité.', 'France', 'Toulon', '4 Mesta Parkway', 5.9294606, 43.1283145, '3807309603', 'https://img.freepik.com/photos-premium/homme-tenue-panier-legumes-ferme_23-2148579690.jpg');
