insert into Producteur (id_producteur, id_utilisateur, description, country, city, street_address, longitude, latitude, phone_number, image) values (369, 91, 'Notre entreprise familiale produit des aliments de qualité supérieure pour vous offrir une expérience gustative inoubliable. Nous sommes passionnés par la culture de produits frais et sains, cultivés en harmonie avec la nature. Nous travaillons en agriculture biologique, sans utiliser de produits chimiques ni de conservateurs, pour vous garantir des aliments naturels et durables. Nous sommes fiers de vous proposer une large sélection de produits locaux et de saison, cueillis à la main et livrés directement chez vous.', 'France', 'Rueil-Malmaison', '0 Haas Court', 2.166848, 48.8708001, '9873541487', 'https://icietla-magazine.com/wp-content/uploads/2019/03/agriculture-centre-bretagne-9.jpg');
insert into Producteur (id_producteur, id_utilisateur, description, country, city, street_address, longitude, latitude, phone_number, image) values (370, 82, 'Nous sommes une entreprise familiale, qui produit des aliments de qualité supérieure en utilisant des méthodes biologiques et respectueuses de l''environnement. Nous sommes convaincus que la nourriture doit être saine, savoureuse et nutritive, c''est pourquoi nous cultivons nos produits avec amour et dévouement. Nous sommes fiers de vous proposer une grande variété de produits locaux et de saison, tels que des légumes, des fruits, des œufs, des viandes et bien plus encore. Nous sommes impatients de vous faire découvrir la qualité de nos produits, que vous pouvez commander en ligne et récupérer chez nous en toute sécurité.', 'France', 'Limoges', '36326 Spenser Junction', 3.5276642, 45.521519, '1998127506', 'https://blog-eco-bzh.chambres-agriculture.fr/wp-content/uploads/2023/01/agricultrice-et-sa-vache-800x450.jpg');
