insert into Producteur (id_producteur, id_utilisateur, description, country, city, street_address, longitude, latitude, phone_number, image) values (605, 34, 'Nous sommes une entreprise familiale, qui produit des aliments de qualité supérieure en utilisant des méthodes biologiques et respectueuses de l''environnement. Nous sommes convaincus que la nourriture doit être saine, savoureuse et nutritive, c''est pourquoi nous cultivons nos produits avec amour et dévouement. Nous sommes fiers de vous proposer une grande variété de produits locaux et de saison, tels que des légumes, des fruits, des œufs, des viandes et bien plus encore. Nous sommes impatients de vous faire découvrir la qualité de nos produits, que vous pouvez commander en ligne et récupérer chez nous en toute sécurité.', 'France', 'Sannois', '5332 Esch Court', 2.2558072, 48.9648921, '2757118674', 'https://blog-eco-bzh.chambres-agriculture.fr/wp-content/uploads/2023/01/agricultrice-et-sa-vache-800x450.jpg');
insert into Producteur (id_producteur, id_utilisateur, description, country, city, street_address, longitude, latitude, phone_number, image) values (606, 21, 'Chez nous, chaque produit est un véritable chef-d''œuvre de la nature. Nous sommes des producteurs passionnés, qui cultivent des aliments de qualité supérieure en respectant les traditions culinaires et les méthodes biologiques. Nous sommes fiers de vous proposer une large sélection de produits locaux et de saison, tels que des fruits, des légumes, des herbes aromatiques et bien plus encore.', 'France', 'Romilly-sur-Seine', '13 Kedzie Court', 3.6973504, 48.5202109, '4633853985', 'https://easy-agri.com/wp-content/uploads/2019/11/eleveur_pro_easy-agri-1-750x500.jpg');
insert into Producteur (id_producteur, id_utilisateur, description, country, city, street_address, longitude, latitude, phone_number, image) values (607, 6, 'Nous sommes des agriculteurs passionnés, engagés dans une agriculture durable et responsable. Nous travaillons avec des méthodes respectueuses de l''environnement et des animaux, pour produire des aliments sains et savoureux. Nous sommes fiers de proposer une variété de produits locaux, tels que des viandes, des œufs, des légumes et des fruits, tous issus de notre propre production. Nous sommes convaincus que nos produits vont vous plaire et nous avons hâte de vous les faire découvrir.', 'France', 'Mulhouse', '6 Goodland Pass', 7.3507066, 47.7489727, '7521554712', 'https://icietla-magazine.com/wp-content/uploads/2019/03/agriculture-centre-bretagne-9.jpg');
insert into Producteur (id_producteur, id_utilisateur, description, country, city, street_address, longitude, latitude, phone_number, image) values (608, 99, 'Nous sommes une entreprise familiale spécialisée dans la production de produits frais et savoureux. Nous sommes convaincus que la qualité de nos aliments est essentielle pour garantir une alimentation saine et équilibrée. C''est pourquoi nous avons à cœur de cultiver nos produits avec soin et sans utiliser de produits chimiques nocifs. Nous travaillons en agriculture raisonnée et privilégions les circuits courts pour vous proposer des produits locaux et de saison.', 'France', 'Pantin', '928 Bunker Hill Crossing', 4.26286, 45.7608815, '9725009007', 'https://easy-agri.com/wp-content/uploads/2019/11/eleveur_pro_easy-agri-1-750x500.jpg');
insert into Producteur (id_producteur, id_utilisateur, description, country, city, street_address, longitude, latitude, phone_number, image) values (609, 76, 'Nous sommes une petite entreprise familiale, qui produit des aliments bio et locaux de qualité supérieure. Nous sommes convaincus que la nourriture doit être saine, savoureuse et respectueuse de l''environnement. C''est pourquoi nous cultivons nos produits en harmonie avec la nature, en utilisant des méthodes biologiques et des semences naturelles. Nous sommes fiers de vous proposer une variété de produits frais et de saison, cueillis à la main et livrés chez vous en toute sécurité. Nous sommes impatients de vous faire découvrir nos produits de qualité.', 'France', 'Troyes', '42781 Eastwood Road', 4.024099, 48.305818, '1456355308', 'https://agridemain.fr/wp-content/uploads/2019/05/GONNET-Rene-Nadine.jpg');
insert into Producteur (id_producteur, id_utilisateur, description, country, city, street_address, longitude, latitude, phone_number, image) values (610, 68, 'Nous sommes des agriculteurs passionnés, qui cultivent des aliments sains et savoureux en respectant la nature et l''environnement. Nous travaillons en agriculture biologique, sans utiliser de produits chimiques ni de conservateurs, pour vous garantir des aliments naturels et durables. Nous sommes fiers de vous proposer une large sélection de produits locaux et de saison, tels que des légumes, des fruits, des herbes aromatiques, des miels et bien plus encore. Nous espérons que vous apprécierez la qualité de nos produits, que nous livrons directement chez vous.', 'France', 'Saint-Flour', '50 High Crossing Trail', 2.9802744, 45.1238884, '4051393745', 'https://icietla-magazine.com/wp-content/uploads/2019/03/agriculture-centre-bretagne-9.jpg');
