insert into Producteur (id_producteur, id_utilisateur, description, country, city, street_address, longitude, latitude, phone_number, image) values (844, 66, 'Nous sommes des agriculteurs passionnés, engagés dans une agriculture durable et responsable. Nous travaillons avec des méthodes respectueuses de l''environnement et des animaux, pour produire des aliments sains et savoureux. Nous sommes fiers de proposer une variété de produits locaux, tels que des viandes, des œufs, des légumes et des fruits, tous issus de notre propre production. Nous sommes convaincus que nos produits vont vous plaire et nous avons hâte de vous les faire découvrir.', 'France', 'Aurillac', '066 Loftsgordon Park', 2.4396467, 44.9263486, '7825646319', 'https://media.istockphoto.com/id/1269841295/fr/photo/vue-lat%C3%A9rale-dun-agriculteur-a%C3%AEn%C3%A9-debout-dans-le-champ-de-ma%C3%AFs-examinant-la-culture-au.jpg?s=612x612&w=0&k=20&c=uaJfK9brnDiNL6UKOkIloLqUNGG9du9SigDk7j-Xx-8=');
